import React from 'react';
import {StyledLayout} from "./styles/Layout.styled";
import {StyledFlexCol} from "./styles/FlexCol.styled";


const Layout = ({children}) => {
    return (
        <StyledLayout>
        <StyledFlexCol>

            <nav>
                <h2>Logo</h2>
                <h2>Faves/Search</h2>
            </nav>
            {children}
            <footer>Hello I am Footer</footer>

        </StyledFlexCol>
        </StyledLayout>
    );
};

export default Layout;
